import { Box, Grid, ImageList, ImageListItem, Typography } from "@material-ui/core";
import Mansonry, {ResponsiveMasonry} from "react"



function AboutMe() {
    return (
        <Grid container backgroundColor='red' height='100%' justifyContent='center' px={4}>
            <Grid item>
                <ImageList variant='quilted' cols={3} rowHeight={100} sx={{width:500, height:1, m:0}}>
                    <ImageListItem cols={2} rows={2} sx={{backgroundColor:'blue'}}>
                        <Typography>bbb</Typography>
                    </ImageListItem>
                </ImageList>
            </Grid>

        </Grid>
    )
}

export default AboutMe;
